import React from 'react';

const Sidebar = () => {
  return (
    <aside className="w-64 bg-white p-5">
      <nav className="flex flex-col">
        {/* Active link has bg-blue-500, text-white and rounded-md */}
        <a href="#" className="text-gray-700 hover:bg-blue-500 hover:text-white px-2 py-1 rounded-md">Dashboard</a>
        <a href="#" className="text-gray-700 hover:bg-blue-500 hover:text-white px-2 py-1 rounded-md">Profile</a>
        <a href="#" className="text-gray-700 hover:bg-blue-500 hover:text-white px-2 py-1 rounded-md">Go Live</a>
        {/* ... other navigation items ... */}
      </nav>
    </aside>
  );
};

export default Sidebar;
